/** @ingroup Elements
  * @class Elem_Tet20
  *
  * @brief Tetrahedral cubic element with 20 nodes.
  * @details Solid element, with cubic interpolation functions, tetrahedral shape.
  * Options for integration points: 10, 11, 14, 15 and 24.
  * @image html Elem_Tet20.png height=300
  */
class Elem_Tet20 : public ElementSolid
{
private:
	Elem_Tet20() = delete;

protected:
	/** Constructor for tetrahedral cubic elements.
	  * @param Material Pointer to Material class.
	  */
	explicit Elem_Tet20(std::shared_ptr<Material>& Material)
		: ElementSolid(Material) { };

public:
	// Output function for AcadView, based on element index.
	const std::string printByIndex_AV(const size_t add) const override {
		std::stringstream msg;
		msg << "2 3 " << this->v_Conect[0]->m_index + add << " " << this->v_Conect[1]->m_index + add << " " << this->v_Conect[2]->m_index + add << " "
			<< this->v_Conect[3]->m_index + add << " " << this->v_Conect[4]->m_index + add << " " << this->v_Conect[5]->m_index + add << " "
			<< this->v_Conect[6]->m_index + add << " " << this->v_Conect[7]->m_index + add << " " << this->v_Conect[8]->m_index + add << " "
			<< this->v_Conect[9]->m_index + add << " " << this->m_Mat->m_index << "\n";
		msg << "2 3 " << this->v_Conect[0]->m_index + add << " " << this->v_Conect[1]->m_index + add << " " << this->v_Conect[2]->m_index + add << " "
			<< this->v_Conect[3]->m_index + add <<  " " << this->v_Conect[10]->m_index + add << " " << this->v_Conect[11]->m_index + add << " "
			<< this->v_Conect[12]->m_index + add << " " << this->v_Conect[16]->m_index + add << " " << this->v_Conect[17]->m_index + add << " "
			<< this->v_Conect[19]->m_index + add << " " << this->m_Mat->m_index << "\n";
		msg << "2 3 " << this->v_Conect[0]->m_index + add << " " << this->v_Conect[4]->m_index + add << " " << this->v_Conect[7]->m_index + add << " "
			<< this->v_Conect[9]->m_index + add <<  " " << this->v_Conect[10]->m_index + add << " " << this->v_Conect[13]->m_index + add << " "
			<< this->v_Conect[15]->m_index + add << " " << this->v_Conect[16]->m_index + add << " " << this->v_Conect[18]->m_index + add << " "
			<< this->v_Conect[19]->m_index + add << " " << this->m_Mat->m_index << "\n";
		msg << "2 3 " << this->v_Conect[3]->m_index + add << " " << this->v_Conect[6]->m_index + add << " " << this->v_Conect[8]->m_index + add << " "
			<< this->v_Conect[9]->m_index + add <<  " " << this->v_Conect[12]->m_index + add << " " << this->v_Conect[14]->m_index + add << " "
			<< this->v_Conect[15]->m_index + add << " " << this->v_Conect[17]->m_index + add << " " << this->v_Conect[18]->m_index + add << " "
			<< this->v_Conect[19]->m_index + add << " " << this->m_Mat->m_index << "\n";
		return msg.str();
	};

	// Output function for AcadView, based on element node number.
	const std::string printByAdder_AV(const size_t add) const override {
		std::stringstream msg;
		msg << "2 3 " << (1 + add) << " " << (2 + add) << " " << (3 + add) << " " << (4 + add) << " "
			<< (5 + add) << " " << (6 + add) << " " << (7 + add) << " " << (8 + add) << " "
			<< (9 + add) << " " << (10 + add) << " " << this->m_Mat->m_index << "\n";
		msg << "2 3 " << (1 + add) << " " << (2 + add) << " " << (3 + add) << " " << (4 + add) << " "
			<< (11 + add) << " " << (12 + add) << " " << (13 + add) << " " << (17 + add) << " "
			<< (18 + add) << " " << (20 + add) << " " << this->m_Mat->m_index << "\n";
		msg << "2 3 " << (1 + add) << " " << (5 + add) << " " << (8 + add) << " " << (10 + add) << " "
			<< (11 + add) << " " << (14 + add) << " " << (16 + add) << " " << (17 + add) << " "
			<< (19 + add) << " " << (20 + add) << " " << this->m_Mat->m_index << "\n";
		msg << "2 3 " << (4 + add) << " " << (7 + add) << " " << (9 + add) << " " << (10 + add) << " "
			<< (13 + add) << " " << (15 + add) << " " << (16 + add) << " " << (18 + add) << " "
			<< (19 + add) << " " << (20 + add) << " " << this->m_Mat->m_index << "\n";
		return msg.str();
	};

	// Evaluates shape function in the point.
	Eigen::VectorXd getShapeFcOnPoint(const double* Point) override;

	// Evaluates the derivative of shape function in the point.
	Eigen::MatrixXd getShapeDerivOnPoint(const double* Point) override;

	// Returns the number of nodes of current element.
	int getNumNodes() override { return m_NumNodes; };

	// Returns the number of faces of current element.
	int getNumFaces() override { return m_NumFaces; };

	/** Verifies dimensionless coordinates from input - if it is immersed on the element.
	  * @return True if input falls within the element.
	  * @param xsi Trial dimensionless coordinates.
	  */
	bool evaluateXsi(const std::array<double, m_Dim> xsi) override {

		std::array<double, m_Dim + 1> new_xsi = {};

		for (int i = 0; i < m_Dim; ++i) {
			new_xsi.at(i) = xsi.at(i);
			new_xsi.at(m_Dim) -= xsi.at(i);
		}
		new_xsi.at(m_Dim) += 1.;

		const auto [min, max] = std::minmax_element(new_xsi.begin(), new_xsi.end());
		if (*max < 1.000001 && *min > -0.000001) return true;
		return false;
	};

private:
	// Evaluate centroid and circumsphere Radius. Must be called after setting the conectivity.
	void setGeomProperties() override;

protected:
	/** @brief Number of Nodes */
	static const int m_NumNodes{ 20 };

	/** @brief Number of Faces */
	static const int m_NumFaces{ 4 };
};


/**
  * @class Elem_Tet20_IP
  *
  * @brief Tetrahedral cubic element with 20 nodes.
  * @details Solid element, with cubic interpolation functions, tetrahedral shape.
  *
  * @tparam nIP Number of integration points. Must be: 10, 11, 14, 15 or 24.
  */
template<int nIP>
class Elem_Tet20_IP : public Elem_Tet20
{
private:
	Elem_Tet20_IP() = delete;

public:
	/** Constructor for tetrahedral cubic elements.
	  * @param Material Pointer to Material class.
	  */
	explicit Elem_Tet20_IP(std::shared_ptr<Material>& Material)
		: Elem_Tet20(Material) { };

	// Returns a pointer to the first element of the shape functions (with size [nIP][m_NumNodes]).
	double const* getShapeFc() const override { return &m_Psi[0][0]; };

	// Returns a pointer to the first element of the derivative of shape functions (with size [nIP][m_NumNodes][m_Dim]).
	double const* getShapeDerivative() const override { return &m_DPsi[0][0][0]; };

	// Returns a pointer to the weight of the integation points (with size [nIP]).
	double const* getWeight() const override { return m_weight; };

	// Returns the number of integration points of current element.
	int getNumIP() override { return nIP; };

private:
	// Weights for numerical integration
	static const double* m_weight;

	// Shape functions
	static const double m_Psi[nIP][m_NumNodes];

	// Shape functions derivative
	static const double m_DPsi[nIP][m_NumNodes][m_Dim];
};


