	Psi(2) = 9. * Point[0] - 22.5 * Point[0] * Point[2] + 13.5 * Point[0] * Point[2] * Point[2] - 22.5 * Point[0] * Point[1] + 27. * Point[0] * Point[1] * Point[2] + 13.5 * Point[0] * Point[1] * Point[1] - 22.5 * Point[0] * Point[0] + 27. * Point[0] * Point[0] * Point[2] + 27. * Point[0] * Point[0] * Point[1] + 13.5 * Point[0] * Point[0] * Point[0];
